from flask import Flask, render_template, request
import requests
import json

app = Flask(__name__)

@app.route("/")
def main():
    return render_template("index.html")

@app.route('/party')
def party():
    # 쿼리 파라미터로 전달받은 movie, snack 정보 꺼내기
    movie = json.loads(request.args.get('movie', ''))
    snack = json.loads(request.args.get('snack', ''))

    return render_template('party.html', movie=movie, snack=snack)
    

